const input = $input.item.json.output;

// Extract values using regex (safe, no JSON.parse required)
const phoneMatch = input.match(/phone_number:\s*"(.*?)"/);
const firstMessageMatch = input.match(/vapi_voice_call_first_message:\s*"(.*?)"/);
const contextPromptMatch = input.match(/vapi_voice_call_context_prompt:\s*"(.*?)"/);

return [
  {
    json: {
      phone_number: phoneMatch ? phoneMatch[1] : null,
      vapi_voice_call_first_message: firstMessageMatch ? firstMessageMatch[1] : null,
      vapi_voice_call_context_prompt: contextPromptMatch ? contextPromptMatch[1] : null
    }
  }
];
